if [ ! "__i4j_lang_restart" = "$1" ]; then

if [ -f "$prg_dir/jre.tar.gz" ] && [ ! -f jre.tar.gz ] ; then
  cp "$prg_dir/jre.tar.gz" .
fi


if [ -f jre.tar.gz ]; then
  echo "Unpacking JRE ..."
  gunzip jre.tar.gz
  mkdir jre
  cd jre
  tar xf ../jre.tar
  app_java_home=`pwd`
  bundled_jre_home="$app_java_home"
  cd ..
