  echo The version of the JVM must be at least 1.8.
  echo Please define INSTALL4J_JAVA_HOME to point to a suitable JVM.
returnCode=83
cd "$old_pwd"
  if [ ! "W $INSTALL4J_KEEP_TEMP" = "W yes" ]; then
     rm -R -f "$sfx_dir_name"
  fi
exit $returnCode
fi


compiz_workaround

packed_files="*.jar.pack user/*.jar.pack user/*.zip.pack"
for packed_file in $packed_files
do
  unpacked_file=`expr "$packed_file" : '\(.*\)\.pack$'`
  $app_java_home/bin/unpack200 -q -r "$packed_file" "$unpacked_file" > /dev/null 2>&1
done

local_classpath=""
i4j_classpath="i4jruntime.jar:user.jar"
add_class_path "$i4j_classpath"
for i in `ls "user" 2> /dev/null | egrep "\.(jar|zip)$"`
do
  add_class_path "user/$i"
done

vmoptions_val=""
read_vmoptions "$prg_dir/$progname.vmoptions"
INSTALL4J_ADD_VM_PARAMS="$INSTALL4J_ADD_VM_PARAMS $vmoptions_val"

INSTALL4J_ADD_VM_PARAMS="$INSTALL4J_ADD_VM_PARAMS -Di4j.vpt=true"
for param in $@; do
  if [ `echo "W$param" | cut -c -3` = "W-J" ]; then
    INSTALL4J_ADD_VM_PARAMS="$INSTALL4J_ADD_VM_PARAMS `echo "$param" | cut -c 3-`"
  fi
done

if [ "W$vmov_1" = "W" ]; then
  vmov_1="-Di4jv=0"
fi
if [ "W$vmov_2" = "W" ]; then
  vmov_2="-Di4jv=0"
fi
if [ "W$vmov_3" = "W" ]; then
  vmov_3="-Di4jv=0"
fi
if [ "W$vmov_4" = "W" ]; then
  vmov_4="-Di4jv=0"
fi
if [ "W$vmov_5" = "W" ]; then
  vmov_5="-Di4jv=0"
fi
echo "Starting Installer ..."

$INSTALL4J_JAVA_PREFIX "$app_java_home/bin/java" -Dinstall4j.jvmDir="$app_java_home" -Dexe4j.moduleName="$prg_dir/$progname" -Dexe4j.totalDataLength=1523407 -Dinstall4j.cwd="$old_pwd" "-Dsun.java2d.noddraw=true" "$vmov_1" "$vmov_2" "$vmov_3" "$vmov_4" "$vmov_5" $INSTALL4J_ADD_VM_PARAMS -classpath "$local_classpath" com.install4j.runtime.launcher.UnixLauncher launch 0 "" "" com.install4j.runtime.installer.Installer  "$@"


returnCode=$?
cd "$old_pwd"
  if [ ! "W $INSTALL4J_KEEP_TEMP" = "W yes" ]; then
     rm -R -f "$sfx_dir_name"
  fi
exit $returnCode
